import React from "react";

const DynamicList = ({ song_list }) => {
  return (
    <ul className = "bg-black rounded-lg p-4 border border-white">
      {song_list.map((song) => (
        <li key={song.id} className="">
          <h3 className = "text-white font-mono ">{song.name}</h3>
          <p>{song.artist}</p>
          <img src={song.image_src}/>
        </li>
      ))}
    </ul>
  );
};

export default DynamicList;
